" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Phases of radiation injury",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\" rowspan=\"2\">",
"        Dose (Gy)",
"       </td>",
"       <td class=\"subtitle1\" colspan=\"4\">",
"        Symptoms",
"       </td>",
"       <td class=\"subtitle1\" rowspan=\"2\">",
"        Prognosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\">",
"        Prodrome",
"       </td>",
"       <td class=\"subtitle2\">",
"        Hematologic",
"       </td>",
"       <td class=\"subtitle2\">",
"        GI",
"       </td>",
"       <td class=\"subtitle2\">",
"        Neurologic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        0.5 to 1.0",
"       </td>",
"       <td>",
"        +",
"       </td>",
"       <td>",
"        +",
"       </td>",
"       <td>",
"        0",
"       </td>",
"       <td>",
"        0",
"       </td>",
"       <td>",
"        Survival almost certain",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        1.0 to 2.0",
"       </td>",
"       <td>",
"        +/++",
"       </td>",
"       <td>",
"        +",
"       </td>",
"       <td>",
"        0",
"       </td>",
"       <td>",
"        0",
"       </td>",
"       <td>",
"        Survival &gt;90 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        2.0 to 3.5",
"       </td>",
"       <td>",
"        ++",
"       </td>",
"       <td>",
"        ++",
"       </td>",
"       <td>",
"        0",
"       </td>",
"       <td>",
"        0",
"       </td>",
"       <td>",
"        Probable survival",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        3.5 to 5.5",
"       </td>",
"       <td>",
"        +++",
"       </td>",
"       <td>",
"        +++",
"       </td>",
"       <td>",
"        +",
"       </td>",
"       <td>",
"        0",
"       </td>",
"       <td>",
"        Death in 50 percent&nbsp;at 3.5 to 6 weeks",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        5.5 to 7.5",
"       </td>",
"       <td>",
"        +++",
"       </td>",
"       <td>",
"        +++",
"       </td>",
"       <td>",
"        ++",
"       </td>",
"       <td>",
"        0",
"       </td>",
"       <td>",
"        Death probable in 2 to 3 weeks",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        7.5 to 10",
"       </td>",
"       <td>",
"        +++",
"       </td>",
"       <td>",
"        +++",
"       </td>",
"       <td>",
"        +++",
"       </td>",
"       <td>",
"        0*",
"       </td>",
"       <td>",
"        Death probable in 1 to 2.5 weeks",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        10 to 20",
"       </td>",
"       <td>",
"        +++",
"       </td>",
"       <td>",
"        +++",
"       </td>",
"       <td>",
"        +++",
"       </td>",
"       <td>",
"        +++",
"       </td>",
"       <td>",
"        Death certain in 5 to 12 days",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &gt;20",
"       </td>",
"       <td>",
"        +++",
"       </td>",
"       <td>",
"        +++",
"       </td>",
"       <td>",
"        +++",
"       </td>",
"       <td>",
"        +++",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"       <td>",
"        Death certain in 2 to 5 days",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
